description:
Jimmy, an idealistic and hard-working young man, has just arrived in New York City with dreams of making his fortune. Along the way he faces numerous obstacles, opportunities and temptations, but through it all, he considers the actions of his hero, Abraham Lincoln, for guidance. Will Jimmy see his dreams come true, or will he be another of the countless hopefuls chewed up and spit out by New York's mean streets? &lt;a href=&quot;
